import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-cbecf9b31d33",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/st/workspace/chancesu/docs/README.md").then(comp => {
        Vue.component("v-cbecf9b31d33", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-6432463236172",
    path: "/page1.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/st/workspace/chancesu/docs/page1.md").then(comp => {
        Vue.component("v-6432463236172", comp.default)
        next()
      })
    }
  },
  {
    name: "v-0ec663126a54d",
    path: "/page2.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/st/workspace/chancesu/docs/page2.md").then(comp => {
        Vue.component("v-0ec663126a54d", comp.default)
        next()
      })
    }
  },
  {
    name: "v-2a1d9101b03b5",
    path: "/page3.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/st/workspace/chancesu/docs/page3.md").then(comp => {
        Vue.component("v-2a1d9101b03b5", comp.default)
        next()
      })
    }
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
